[mod-setting-description]
rampant-useDumbProjectiles=옵션 비활성화 시 땅벌레와 스피터의 발사체는 호밍 발사체로 설정됩니다.
rampant-useNEUnitLaunchers=NE모드[에너미]와 함께 사용시에만 NE 유닛 런처를 중형, 대형 땅벌레와 함께 사용합니다. 비활성화 시에는 땅벌레는 유닛을 스폰 하지 않고 발사체만 발사하게 됩니다. 활성화 시에는 발사체 발사 모션으로 유닛이 스폰됩니다.
# rampant-attackWaveGenerationUsePollution=공격 웨이브가 생성될 산란장이 있는 청크에 임계 값에 대한 공해량을 포함시킵니다. 기존 바이터 공격 웨이브에는 영향 주지 않습니다.
rampant-attackWaveGenerationUsePlayerProximity=공격 웨이브를 생성할 산란장이 있는 청크에 임계 값에 대한 플레이어 페로몬 양을 포함시킵니다. 기존 바이터 공격 웨이브에는 영향 주지 않습니다.
rampant-attackWaveGenerationThresholdMax=공격 웨이브가 생성되기 위해 청크가 도달해야 하는 합산 값입니다. 기존 바이터 공격 웨이브에는 영향 주지 않습니다. 진화 요인으로 선형 값을 가집니다. (시작 임계값 @ 0.0 evolution)
rampant-attackWaveGenerationThresholdMin=공격 웨이브가 생성되기 위해 청크가 도달해야 하는 합산 값입니다. 기존 바이터 공격 웨이브에는 영향 주지 않습니다. 진화 요인으로 선형 값을 가집니다. (끝 임계값 @ 100.0 evolution)
rampant-attackWaveMaxSize=공격 웨이브가 진화와 함께 어떻게 변하는지를 변경하려면 zip 파일에서 config.lua를 수정해야 합니다.
rampant-safeBuildings=이 옵션을 활용하기 위해서는 아래에 각 해당하는 건물 옵션을 활성화해야 합니다. destructible 플래그를 false로 설정하여 다시 건설 한 건물이 대상이 되거나 손상되지 않게 됩니다.
rampant-safeBuildings-curvedRail=바이터들의 공격으로부터 곡선 철도를 보호합니다.
rampant-safeBuildings-straightRail=바이터들의 공격으로부터 직선 철도를 보호합니다.
rampant-safeBuildings-bigElectricPole=바이터들의 공격으로부터 대형 전신주를 보호합니다.
rampant-safeBuildings-railChainSignals=바이터들의 공격으로부터 철도 연속 신호기를 보호합니다.
rampant-safeBuildings-railSignals=바이터들의 공격으로부터 철도 신호기를 보호합니다.
rampant-safeBuildings-lamps=바이터들의 공격으로부터 조명를 보호합니다.
rampant-safeBuildings-trainStops=바이터들의 공격으로부터 기차 정류장을 보호합니다.
rampant-attackPlayerThreshold=공격 임계 값에 기여하기 위해 청크가 도달해야 하는 점수입니다. 값이 증가하면 플레이어 페로몬 범위가 감소합니다.
rampant-permanentNocturnal=이 옵션을 활성화하면 밤에 맹렬한 공격 웨이브가 발생합니다. 기존 공격 인공지능을 아직 해제하지 마십시오. 'Day/Night extender'모드와 함께 사용 시 더 잘 작동합니다.
rampant-aiPointsScaler=0.0 ~ 5.0 사이로 설정 가능합니다. 공격 웨이브를 만드는 것과 같은 동작을 수행하기 위해 논리 주기 당 AI가 얻는 동작 점수를 조정합니다. 0.3 - 매우 쉬움, 0.75 - 쉬움, 1.0 - 보통, 1.25+ - 어려움
rampant-addWallResistanceAcid=이 옵션을 활성화하면 모든 벽에 %60의 내산성이 추가되어 스피터의 공격으로부터 기본 게임의 피해 수준으로 줄일 수 있습니다.
rampant-useCustomAI=이 기능을 사용하면 기존 인공지능을 완전히 제거하고 바이터의 빌드 방식과 유닛 생성 체계, 공격 방식을 변경합니다.
rampant-removeBloodParticles=바이터 무리가 죽을 때 생성되는 혈액 입자가 UPS에 악영향을 줄 수 있습니다. 이 옵션은 혈액 입자를 제거하여 UPS를 개선합니다.
# rampant-enableBuildings=램펌트 건물 및 기술 활성화
rampant-enableSwarm=유닛들의 Collision mask 크기를 줄여 경로 충돌을 줄이고 공격을 부드럽게 합니다.
rampant-attack-warning=공격 웨이브가 발생 시 경고하는 메시지를 표시합니다.
rampant-newEnemies=전 세계에 분산될 새로운 적들을 추가합니다. 이 옵션은 RAM 최소 요구 사항이  2GB에서 9GB로 증가합니다.
rampant-enemySeed=이 시드는 모든 유닛 생성에 관여합니다. 바이터 세력들의 배치 유형을 변경하고 싶다면 이 값을 변경해야 합니다.
rampant-deadZoneFrequency=땅발레나 산란장 없이 시작하는 영역의 비율입니다.
rampant-newEnemyNestVariations=이 값은 티어 당 변형 수에 해당합니다. 값이 높을수록 적 세력의 변형 곡선이 부드럽게 됩니다. 최솟값: 1, 최댓값: 20
rampant-newEnemyNestTiers=이 값은 티어 수에 해당합니다. 값이 높을수록 적 세력의 변형 곡선이 부드럽게 됩니다.
rampant-newEnemyWormVariations=이 값은 티어 당 변형 수에 해당합니다. 값이 높을수록 적 세력의 변형 곡선이 부드럽게 됩니다. 최솟값: 1, 최댓값: 20
rampant-newEnemyWormTiers=이 값은 티어 수에 해당합니다. 값이 높을수록 적 세력의 변형 곡선이 부드럽게 됩니다.
rampant-newEnemyUnitVariations=이 값은 티어 당 변형 수에 해당합니다. 값이 높을수록 적 세력의 변형 곡선이 부드럽게 됩니다. 최솟값: 1, 최댓값: 20
rampant-newEnemyUnitTiers=이 값은 티어 수에 해당합니다. 값이 높을수록 적 세력의 변형 곡선이 부드럽게 됩니다.
rampant-enableBobsUnits=기본 업그레이드 및 배치 목록에 밥 모드의 산란장, 땅벌레, 유닛들을 추가합니다.
rampant-enableNEUnits=기본 업그레이드 및 배치 목록에 NE 모드의 산란장, 땅벌레, 유닛들을 추가합니다.
rampant-disallowFriendlyFire=적의 스피터와 땅벌레가 스플래시 대미지로 같은 세력의 유닛이나 건물에 피해를 주는 것을 방지합니다.
rampant-tierStart=시작 티어 레벨입니다. 선택된 많은 티어에 대해 최종 단계까지 선형적으로 증가합니다. 최솟값: 1, 최댓값: 10
rampant-tierEnd=최종 티어 레벨입니다. 시작 티어에서 선형적으로 증가한 후에 도달하는 최종 단계입니다. 최솟값: 1, 최댓값: 10
rampant-forceOldProjectiles=활성화 시, 발사체는 더 이상 다른 개체에 영향을 미치지 않습니다.
rampant-disableVanillaAI=기본 게임의 바이터들의 공격 웨이브와 확장 방식을 담당하던 AI를 비활성화합니다.
rampant-enableMigration=AI가 산란장과 땅벌레를 확장할 수 있게 합니다. 맵 설정의 바이터 확장에 영향을 받습니다.

