rampant-unitDroneHealthScaler=새로운 드론 개체의 체력 배율을 조정합니다. 드론들은 와스프와 번식지 세력에 해당됩니다.
rampant-unitDroneSpeedScaler=새로운 드론 개체의 속도 배율을 조정합니다. 드론들은 와스프와 번식지 세력에 해당됩니다.
rampant-unitDroneDamageScaler=새로운 드론 개체의 피해 배율을 조정합니다. 드론들은 와스프와 번식지 세력에 해당됩니다.
rampant-unitDroneRangeScaler=새로운 드론 개체의 사거리 배율을 조정합니다. 드론들은 와스프와 번식지 세력에 해당됩니다.
rampant-unitWormHealthScaler=새로운 땅벌레 개체의 체력 배율을 조정합니다.
rampant-unitWormDamageScaler=새로운 땅벌레 개체의 피해 배율을 조정합니다.
